        <div style="height: 100%">
                <ag-grid-vue
      style="width: 100%; height: 100%;"
      :class="themeClass"
      :columnDefs="columnDefs"
      @grid-ready="onGridReady"
      :defaultColDef="defaultColDef"
      :autoGroupColumnDef="autoGroupColumnDef"
      :rowModelType="rowModelType"
      :treeData="true"
      :isServerSideGroupOpenByDefault="isServerSideGroupOpenByDefault"
      :isServerSideGroup="isServerSideGroup"
      :getServerSideGroupKey="getServerSideGroupKey"></ag-grid-vue>
        </div>
    `,
    components: {
        'ag-grid-vue': AgGridVue,

    },
    setup(props) {
        const columnDefs = ref([{field:"employeeId",
hide:true},{field:"employeeName",
hide:true},{field:"jobTitle"},{field:"employmentType"}]);
        const gridApi = shallowRef();
        const defaultColDef = ref({
    width: 240,
    flex: 1,
    sortable: false,
});
        const autoGroupColumnDef = ref(null);
const rowModelType = ref(null);
const isServerSideGroupOpenByDefault = ref(null);
const isServerSideGroup = ref(null);
const getServerSideGroupKey = ref(null)

        onBeforeMount(() => {
            autoGroupColumnDef.value = {
    field: 'employeeName',
    cellRendererParams: {
        innerRenderer: (params) => {
            // display employeeName rather than group key (employeeId)
            return params.data.employeeName;
        },
    },
};
rowModelType.value = 'serverSide';
isServerSideGroupOpenByDefault.value = (params) => {
    // open first two levels by default
    return params.rowNode.level < 2;
};
isServerSideGroup.value = (dataItem) => {
    // indicate if node is a group
    return dataItem.group;
};
getServerSideGroupKey.value = (dataItem) => {
    // specify which group key to use
    return dataItem.employeeId;
}            
        });

        const onGridReady = (params) => {

        gridApi.value = params.api;



            const updateData = (data) => {
    var fakeServer = createFakeServer(data);
    var datasource = createServerSideDatasource(fakeServer);
    params.api.setGridOption('serverSideDatasource', datasource);
};

            fetch('https://www.ag-grid.com/example-assets/small-tree-data.json')
                .then(resp => resp.json())
                .then(data => updateData(data));
    };

        return {
            columnDefs,
            gridApi,
            defaultColDef,
autoGroupColumnDef,
rowModelType,
isServerSideGroupOpenByDefault,
isServerSideGroup,
getServerSideGroupKey,
            onGridReady,
            themeClass: /** DARK MODE START **/document.documentElement.dataset.defaultTheme || 'ag-theme-quartz'/** DARK MODE END **/,

        }        
    }
}

window.createFakeServer = function createFakeServer(fakeServerData) {
    const fakeServer = {
        data: fakeServerData,
        getData: function (request) {
            function extractRowsFromData(groupKeys, data) {
                if (groupKeys.length === 0) {
                    return data.map(function (d) {
                        return {
                            group: !!d.children,
                            employeeId: d.employeeId,
                            employeeName: d.employeeName,
                            employmentType: d.employmentType,
                            jobTitle: d.jobTitle,
                        };
                    });
                }
                var key = groupKeys[0];
                for (var i = 0; i < data.length; i++) {
                    if (data[i].employeeId === key) {
                        return extractRowsFromData(groupKeys.slice(1), data[i].children.slice());
                    }
                }
            }
            return extractRowsFromData(request.groupKeys, this.data);
        },
    };
    return fakeServer;
}

window.createServerSideDatasource = function createServerSideDatasource(fakeServer) {
    const dataSource = {
        getRows: (params) => {
            console.log('ServerSideDatasource.getRows: params = ', params);
            var allRows = fakeServer.getData(params.request);
            var request = params.request;
            var doingInfinite = request.startRow != null && request.endRow != null;
            var result = doingInfinite
                ? {
                    rowData: allRows.slice(request.startRow, request.endRow),
                    rowCount: allRows.length,
                }
                : { rowData: allRows };
            console.log('getRows: result = ', result);
            setTimeout(() => {
                params.success(result);
            }, 200);
        },
    };
    return dataSource;
}

createApp(VueExample)
    .mount("#app")

